import React, { useState ,useEffect } from 'react';
import api from '../../services/api';

export default function ProjectPage()
{
    let projetck;
    
    const id = localStorage.getItem("projectID");
    
    useEffect(() => {
        api.get('project', {
            headers: {
                id: id,
            }
        }).then(response => {
            projetck = response.data;
        })
    }, []);

    const [project,setProject] = useState({
        id: projetck.id
    });

    return(
        <div>
            <h1></h1>       
        </div>

    )
}
